import React from 'react';
import NotFound from '../Assets/page-not-found.png';
const PageNotFound = () => {
    return (
        <div>
            <img src={NotFound} alt="page not found" className="d-flex justify-content-center align-items-center"/>
        </div>
    );
};

export default PageNotFound;
